import React, { Component } from "react";
import { Typography } from "@material-ui/core";
import "./Skills.css";

class Skills extends Component {
  render() {
    return (
      <div>
        <section id="__Skills">
          <Typography variant="h1" component="h2" gutterBottom>
            Skills Section
          </Typography>
        </section>
      </div>
    );
  }
}

export default Skills;
